import React from 'react';

function Champion({ startingPosition, currentPosition, image, type, starLevel, headliner, items }) {
  return (
    <div
      className="champion"
      style={{ left: startingPosition.left + 'px', top: startingPosition.top + 'px', backgroundImage: image }}
    ></div>
  );
}

export default Champion;
